    [TestClass]
    public class DeconvolutionTest {
        [TestMethod]
        public void ReferenceTest() {
            int inchannels = 2, outchannels = 3, kwidth = 3, kheight = 5, kdepth = 7, inwidth = 13, inheight = 12, indepth = 11;
            int outwidth = inwidth - kwidth + 1, outheight = inheight - kheight + 1, outdepth = indepth - kdepth + 1, batch = 2;

            float[] xval = (new float[inwidth * inheight * indepth * inchannels * batch]).Select((_, idx) => idx * 1e-3f).ToArray();
            float[] yval = (new float[outwidth * outheight * outdepth * outchannels * batch]).Select((_, idx) => idx * 1e-3f).ToArray();
            float[] wval = (new float[kwidth * kheight * kdepth * outchannels * inchannels]).Select((_, idx) => idx * 1e-3f).Reverse().ToArray();

            VariableField x_actual = (Shape.Map3D(inchannels, inwidth, inheight, indepth, batch), xval);
            ParameterField w = (Shape.Kernel3D(inchannels, outchannels, kwidth, kheight, kdepth), wval);
            ParameterField y = (Shape.Map3D(outchannels, outwidth, outheight, outdepth, batch), yval);

            Field x_expect = Deconvolution3D(y, w);
            StoreField err = Abs(x_expect - x_actual);

            (Flow flow, Parameters parameters) = Flow.Optimize(err);

            flow.Execute();

            float[] gy_actual = y.GradState.Value;
            float[] gw_actual = w.GradState.Value;

            AssertError.Tolerance(gw_expect, gw_actual, 1e-7f, 1e-5f, $"not equal gw");

            AssertError.Tolerance(gy_expect, gy_actual, 1e-6f, 1e-4f, $"not equal gy"); /*backward tolerance*/
        }

